import React, { Component} from "react";
import '../utilities.css'
import "./Post.css";


class Post extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <p>{JSON.stringify(this.props)}</p>
            </div>
        )
    }
};

export default Post;
